			"x": 96,
			"y": 243
		},
		{
			"_uuid": "ca45d8d10f7e4a9fa4111a92c3601b6a",
			"current_frame": "normal",
			"custom": true,
			"label": "_4004bf4f",
			"on_conversation_part1": "[
				level.player.store_event('started_initial_prospera_conversation', 1),
				frogatto.add_control_lock([], 'prospera_cutscene'),
				
				speech_dialog(
								set(level.zoom, p_zoom),
								set(prospera.animation, 'emote_talk'),
								lib.audio.play_music(me,'silence.ogg'),
					prospera,	[~What's this, now?~],
								set(frogatto.animation, 'emote_confused'),
								set(level.zoom, f_zoom),
					frogatto,	[~What's what?~],
								set(level.zoom, p_zoom),
								set(prospera.animation, 'emote_annoyed'),
					prospera,	[~You.~],
								set(prospera.animation, 'emote_annoyed'),
								[~You'll pardon my being brusque, but\\nI have no idea who you are.~],
								set(prospera.animation, 'emote_talk'),
								[~And it tends to happen that complete\\nstrangers are usually up to no good.~],
								set(prospera.animation, 'emote_annoyed'),
								[~Care to explain yourself?~,
									~Imoti sent me.~, [speech_dialog(
													set(frogatto.animation, 'emote_raisedfinger'),
													set(level.zoom, f_zoom),
										frogatto,	[~Uhh...  Imoti sent me!\\nYou guys know each other, right?~],
													set(frogatto.animation, 'emote_confused'),
													[~I mean ... I'm a little nervous here.\\nHe said you're a witch.~],
													lib.audio.play_music(me,'prospera-theme.ogg'),
													set(level.zoom, p_zoom),
													set(prospera.animation, 'emote_talk'),
										prospera,	[~And perhaps I am.~],
													set(frogatto.animation, 'emote_confused'),
													set(level.zoom, f_zoom),
										frogatto,	[~Well, what does that mean?~],
													set(level.zoom, p_zoom),
													set(prospera.animation, 'emote_talk'),
										prospera,	[~It means I'd like to know\\nwhat you're doing here..~],
													set(frogatto.animation, 'emote_oh'),
													set(level.zoom, f_zoom),
										frogatto,	[~That ... doesn't answer my question,\\nbut okay...~],
													set(frogatto.animation, 'emote_confused'),
													[~Imoti told me to bring you a watercrust.\\nHe said it'd be a good excuse to talk to you.~],
													set(level.zoom, p_zoom),
										prospera,	[~...~],
													execute(prospera, [set(prospera.animation, 'emote_cross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_talk_with_arms_crossed')]),
													[~I asked him to do that five hours ago.~],
													set(prospera.animation, 'emote_talk_with_arms_crossed'),
													[~That bumbling blob.\\nIs he just lazing against a tree somewhere?~],
													set(frogatto.animation, 'emote_confused'),
													set(level.zoom, f_zoom),
										frogatto,	[~Well...  actually... <em>yes.</em>\\nHe is.~],
													set(frogatto.animation, 'emote_talk'),
													[~I take it this isn't a surprise?~],
													set(level.focus, [prospera]),
										prospera,	[~...~],
													execute(prospera, [set(prospera.animation, 'emote_uncross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_annoyed')]),
													[~Not in the least, I'm afraid.~],
													fire_event(me,'conversation_part2alt_transit'),
									)],
									~Why should I?~,	[speech_dialog(
													set(frogatto.animation, 'emote_geez'),
													set(level.zoom, p_zoom),
										frogatto,	[~Why should I?\\nI have every right to be here.~],
													set(level.zoom, f_zoom),
													set(prospera.animation, 'emote_annoyed'),
										prospera,	[~No, you don't.  Not at all.\\nThis is <em>my</em> house.~],
													set(prospera.animation, 'emote_talk'),
													[~You're on private property and\\nyou're being pretty shifty.~],
													set(prospera.animation, 'emote_annoyed'),
													[~Explain yourself, now, or I'll give you\\nthe surprise of a lifetime.~],
													set(frogatto.animation, 'emote_confused'),
													set(level.zoom, p_zoom),
										frogatto,	[~...~],
													set(frogatto.animation, 'emote_raisedfinger'),
													[~Sure!\\nI love surprises.~],
													set(level.zoom, f_zoom),
													set(prospera.animation, 'emote_annoyed'),
										prospera,	[~Okay.~],
													fire_event(me,'conversation_part2_cast_spell'),
									)],
								],
				),
			] 	
				where p_zoom = 1.40
				where f_zoom = 1.5
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_conversation_part2_cast_spell": "[
				set(level.zoom, 1.0),
				sound('magic-float.wav', 0.7),
				spawn('prospera_npc.magic_spell_projectile', prospera.mid_x, prospera.mid_y, facing,
					[animate(child, {mid_x: frogatto.mid_x, mid_y: frogatto.mid_y}, {duration: 100, easing: lib.math.ease_in_sine}), schedule(110, die())] ),
				schedule(100, [
					map(range(10), schedule(3*index + 1d(index), spawn('prospera_npc.magic_spell_burst',frogatto.mid_x+1d60-30, frogatto.mid_y+1d60-30,1))),
					schedule(18, spawn('prospera_npc.magic_spell_burst',frogatto.mid_x+1d20-10, frogatto.mid_y+1d20-10,{be_huge: true})),
					spawn('star_particle.burst', frogatto.mid_x, frogatto.mid_y, facing),
					sound('magic-poof.wav', 1.0),
				]),
				schedule(130, [
					screen_flash([255,255,255,255], [0,0,0,0], 50),
				]),
				schedule(180, [
					screen_flash([255,255,255,255], [0,0,0,-2], 150),
				]),
				
				schedule(180, fire_event(me,'conversation_part3_prospera_transit') ),
			] 	
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_conversation_part2alt_transit": "[
				set(level.zoom, 1.5),
				prospera.walk_to(620,  def() -> commands [schedule(80, fire_event(me,'conversation_part3alt'))] )		
			] 	
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_conversation_part3_prospera_transit": "[
				set(level.zoom, 1.5),
				set(level.focus, [prospera]),
				prospera.walk_to(620,  def() -> commands [schedule(80, fire_event(me,'conversation_part4'))] )		
			] 	
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_conversation_part3alt": "[
				speech_dialog(
								set(prospera.animation, 'emote_talk'),
					prospera,	[~So, I think it's time I said ...\\nHello there.  Welcome.~],
								set(prospera.animation, 'emote_emphatic'),
								[~You seem like a reasonable enough person\\nto not chase off the property.~],
								set(prospera.animation, 'emote_annoyed'),
								[~Not yet, at least.~],
								fire_event(me,'conversation_part5'),
				)
			] 	
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_conversation_part4": "[
							speech_dialog(
							set(level.focus, [frogatto]),
							spawn('prospera_npc.magic_spell_aftermath', frogatto.mid_x, frogatto.mid_y, facing),
							set(frogatto.animation, 'emote_oh'),
				frogatto,	[~Whoa...~],
							set(frogatto.animation, 'emote_oh'),
							[~What was <em>that</em>?~],
							set(frogatto.animation, 'emote_confused'),
							[~What just happened?~],
							set(level.focus, [camera_prospera]),
							lib.audio.play_music(me,'prospera-theme.ogg'),
							set(prospera.animation, 'emote_talk'),
				prospera,	[~Magic.~],
							set(prospera.animation, 'emote_talk'),
							[~So tell me, how do you feel?~],
							set(level.focus, [camera_frogatto]),
							set(frogatto.animation, 'emote_confused'),
				frogatto,	[~Vaguely existential?~],
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_emphatic'),
				prospera,	[~Look at your hands!~],
							set(level.focus, [camera_frogatto]),
							set(frogatto.animation, 'emote_confused'),
				frogatto,	[~Uhm... okay.~],
							set(frogatto.animation, 'emote_impatient'),
							[~They're calloused and careworn?~],
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_annoyed'),
				prospera,	[~No, <em>LOOK AT THEM!</em>\\nLook at yourself!~],
							set(level.zoom, 2),
							set(level.focus, [camera_frogatto]),
							set(frogatto.animation, 'emote_geez'),
				frogatto,	[~Look, I'm really confused.\\nWhat's obvious here that I'm not seeing?~],
							set(level.zoom, 2.5),
							set(level.focus, [prospera]),
							set(prospera.animation, 'emote_annoyed'),
				prospera,	[~You're a frog.~],
							set(level.zoom, 2),
							set(level.focus, [frogatto]),
							set(frogatto.animation, 'emote_geez'),
				frogatto,	[~Yes?~],
							set(level.zoom, 2.5),
							set(frogatto.animation, 'emote_confused'),
							[~I mean, I guess I've really never been\\n<em>mindful</em> of that, particularly...~],
							set(frogatto.animation, 'emote_oh'),
							[~But that's actually kinda...\\n deep, and ... philosophical.~],
							set(frogatto.animation, 'emote_confused'),
							set(level.zoom, 3),
							[~This is pretty intense.~],
							set(level.focus, [prospera]),
							set(level.zoom, 3),
							execute(prospera, [set(prospera.animation, 'emote_cross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_talk_with_arms_crossed')]),
				prospera,	[~<em>I turned you into a frog.</em>\\nClue into that already!~],
							set(level.zoom, 2.5),
							set(prospera.animation, 'emote_talk_with_arms_crossed'),
							[~See, if you ask nicely, I might turn you back.~],
							set(level.zoom, 1.5),
							set(level.focus, [frogatto]),
							set(frogatto.animation, 'emote_confused'),
				frogatto,	[~I'm not sure this worked out\\nthe way you seem to think...~],
							set(level.focus, [camera_prospera]),
							execute(prospera, [set(prospera.animation, 'emote_uncross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_annoyed')]),
				prospera,	[~Which part?\\nI mean, you're quite clearly a frog.~],
							set(frogatto.animation, 'emote_geez'),
							set(level.zoom, 2),
							set(level.focus, [camera_frogatto]),
				frogatto,	[~Yeah, but I've <em>always</em> been a frog.~],
							set(level.zoom, 2),
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_surprised'),
				prospera,	[~... wait.  What?!~],
							set(prospera.animation, 'emote_surprised'),
							[~You were already a frog <em>BEFORE</em> I did that?!?~],
							set(level.zoom, 1.5),
							set(level.focus, [camera_target]),
							set(frogatto.animation, 'emote_raisedfinger'),
				frogatto,	[~I'm afraid so.~],
							set(level.focus, [prospera]),
							set(level.zoom, 2.5),
							execute(prospera, [set(prospera.animation, 'emote_remove_hat'); sleep_until_animation_finished(); set(prospera.animation, 'emote_talk_with_hat_off')]),
				prospera,	[~Gosh.\\nI'm at a loss for words.~],
							set(prospera.animation, 'emote_talk_with_hat_off'),
							[~...~,~I'm going to be perfectly honest...~],
							execute(prospera, [set(prospera.animation, 'emote_restore_hat'); sleep_until_animation_finished(); set(prospera.animation, 'emote_talk')]),
							[~This has never happened.~],
							set(level.focus, [camera_prospera]),
							set(level.zoom, 1.5),
							set(prospera.facing, -1),
							set(prospera.animation, 'emote_surprised'),
							[~I've never turned something <em>into itself.</em>~],
							set(prospera.animation, 'emote_emphatic'),
							[~In fact I actually don't even know\\nwhat's <em>supposed</em> to happen.~],
							set(prospera.facing, 1),
							set(prospera.animation, 'emote_talk'),
							[~Do you feel unusually froggy?\\nLike ... more 'yourself' than usual?~],
							set(prospera.animation, 'emote_emphatic'),
							[~Maybe ... <em>twice</em> the frog you used to be?~],
							set(frogatto.animation, 'emote_confused'),
							set(level.focus, [camera_frogatto]),
				frogatto,	[~uhh...~],
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_emphatic'),
				prospera,	[~I think you'll be fine, if you feel normal.\\nI guess?~],
							set(frogatto.animation, 'emote_raisedfinger'),
							set(level.focus, [camera_frogatto]),
				frogatto,	[~I hope so.~],
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_annoyed'),
				prospera,	[~So I feel like we might have\\ngotten off on the wrong foot.~],
							set(prospera.animation, 'emote_talk'),
							[~My name's Prospera.~],
							set(prospera.animation, 'emote_emphatic'),
							[~I live here, I'm a witch.\\nI protect this village.~],
							set(prospera.animation, 'emote_surprised'),
							[~It's a long story.~],
				),
			
				fire_event(me,'conversation_part5'),
			] 	
				where camera_prospera = get_object_or_die(level, 'prospera_camera')
				where camera_frogatto = get_object_or_die(level, 'frogatto_camera')
				where camera_target = get_object_or_die(level, 'camera_target')
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_conversation_part5": "[
							speech_dialog(
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_annoyed'),
				prospera,	[~So, I have to ask...\\nWhat are you here, for, really?~],
							set(frogatto.animation, 'emote_nod'),
							set(level.focus, [camera_frogatto]),
				frogatto,	[~Well, to make a long story short,\\nI'm trying to go east, and there are these\\nblue force fields in the way.~],
							set(frogatto.animation, 'emote_raisedfinger'),
							[~Imoti told me you knew how to take them down.~],
							set(frogatto.animation, 'emote_confused'),
							[~Would you be willing to do that?~],
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_annoyed'),
				prospera,	[~No.\\nThey're there for a very good reason.~],
							set(prospera.animation, 'emote_talk'),
							[~Firstly, it's to protect the town from\\nsomething pretty nasty, to the east.~],
							set(prospera.animation, 'emote_talk'),
							[~Secondly, it's to protect hapless tourists\\nfrom an unpleasant and quite permanent detour.~],
							set(prospera.animation, 'emote_annoyed'),
							[~Folks like, for example, <em>you</em>.~],
							set(prospera.animation, 'emote_emphatic'),
							[~I wouldn't go over there unless you\\n<em>really</em> know what you're doing.~],
							set(frogatto.animation, 'emote_geez'),
							set(level.focus, [camera_frogatto]),
				frogatto,	[~Well, supposing I do -\\nwhat could we work out?~],
							set(frogatto.animation, 'emote_oh'),
							[~I'd really like to head in that direction...\\nis there any way you could help?~],
							set(frogatto.animation, 'emote_confused'),
							[~... assuming I helped you out first?~],
							set(level.focus, [camera_prospera]),
							set(prospera.animation, 'emote_surprised'),
				prospera,	[~Maybe.~],
							set(prospera.animation, 'emote_annoyed'),
							[~I suppose I can't afford to be too proud.~],
							set(prospera.animation, 'emote_talk'),
							[~Follow me up to my house,\\nand I'll explain the rest, there...~],
				),
				set(level.focus, []),			
				set(level.zoom, 1),
				level.player.store_event('finished_initial_exterior_prospera_conversation',1),

				schedule(50, teleport('prosperas-house.cfg', 'target', 'iris')),
			]
				where camera_prospera = get_object_or_die(level, 'prospera_camera')
				where camera_frogatto = get_object_or_die(level, 'frogatto_camera')
				where camera_target = get_object_or_die(level, 'camera_target')
				where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
				where frogatto = (obj frogatto_playable <- level.player)",
			"on_triggered": "if(
				(not level.player.get_stored_event('started_initial_prospera_conversation'))
			 	and
			 	(not level.player.get_stored_event('defeated_gazer_boss')) /* this is here just in case you're doing the 'alternate route' of beating the boss before meeting prospera. */
			,
				fire_event(me,'conversation_part1'),
				if( level.player.get_stored_event('finished_initial_prospera_conversation') or level.player.get_stored_event('defeated_gazer_boss'), remove_object(me))
			)",
